import React from 'react'
import img from '../Images/MicrosoftTeams-image.png'
import {
  Divider,
  Grid,
  Paper,
  Typography,
  Box,
  Button,
  Input,
} from "@material-ui/core";

export default function Error() {
  return (
   <>
    <Box >
 <Paper  style={{ margin: "2rem" }} >
<Grid>
    <img src={img} alt="error message"  style={{
                brder: "1px solid red",
                margin: "2rem",
                marginBottom: "1rem",
              }}
              padding="1rem"
              width="20%"
  
   />
  <h1 style={{fontFamily: "monospace", color:"red" ,fontSize:"1.3rem"}}>Sorry, looks like we can't deliver this parcel on the route you've entered!</h1>
  </Grid>
  </Paper>
  </Box>
  </>
  
  )
}
